--  Table structure for `company`
-- ----------------------------
DROP TABLE IF EXISTS `company`;
CREATE TABLE `company` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `ftp_host` varchar(255) DEFAULT NULL,
  `ftp_user` varchar(255) DEFAULT NULL,
  `ftp_pass` varchar(255) DEFAULT NULL,
  `mysql_host` varchar(255) DEFAULT NULL,
  `mysql_user` varchar(255) DEFAULT NULL,
  `mysql_pass` varchar(255) DEFAULT NULL,
  `mysql_db` varchar(255) DEFAULT NULL,
  `status` int(1) NOT NULL DEFAULT '1',
  `upload_path` varchar(255) DEFAULT NULL,
  `profile_id` int(255) NOT NULL DEFAULT '0',
  `smtp_user` varchar(255) DEFAULT NULL,
  `smtp_password` varchar(255) DEFAULT NULL,
  `smtp_port` varchar(255) DEFAULT NULL,
  `smtp_host` varchar(255) DEFAULT NULL,
  `email_contact` varchar(255) DEFAULT NULL,
  `developer_group_id` int(255) NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created` tinyint(1) NOT NULL DEFAULT '0',
  `email` varchar(255) NOT NULL,
  `phone` varchar(255) NOT NULL,
  `observation` text NOT NULL,
